import React,{useState} from 'react'
import Card from './Card'
import Data from './Data'
const List = () => {

const [card, setcard] = useState(Data)

  return (
    <div className='list_css'>
        {
              card.map((elem)=>{
                return  <Card key={elem.id}  data={elem}/>
              }
            
              )
        }
       
    </div>
  )
}

export default List
